import {userActionEnum} from "../reducers/user/types";

export const userActionCreators = {
    ASAuth: (payload) => ({type: userActionEnum.SET_AUTH, payload}),
    ASUser: (payload) => ({type: userActionEnum.SET_USER, payload})
}
